        public MovieService()
        {
        }

        private static Dictionary<int, MovieVM> movies= GetInitialData();
        public JsonResult GetMovies(string? searchTerm)
        {
            List<MovieVM> movieData;
            try
            {
                movieData= movies.Values.ToList() as List<MovieVM>;
                if (searchTerm != null)
                {
                    string searchTermLower = searchTerm.ToLower();
                    movieData = movieData.Where(movie => movie.Title.ToLower().Contains(searchTermLower)).ToList();
                }
                return new JsonResult(new ApiResponse<List<MovieVM>>()
                {
                    Data = movieData,
                    Message = ResponseMessage.Success,
                    StatusCode = ResponseCode.Success,
                    Result = true

                });

            }
            catch
            {
                return ReturnError(ResponseMessage.Error, ResponseCode.InternalServerError);
            }
           
        }

        public JsonResult GetMoviesDetails(int id)
        {
            try
            {
                if (movies.ContainsKey(id))
                {
                    MovieVM movie = movies[id];
                    return new JsonResult(new ApiResponse<MovieVM>()
                    {
                        Data = movie,
                        Message = ResponseMessage.Success,
                        StatusCode = ResponseCode.Success,
                        Result = true
                    });
                }
                else
                {
                    return ReturnError(ResponseMessage.MovieNotFound, ResponseCode.NotFound);
                }
  

            }

            catch
            {
                return ReturnError(ResponseMessage.Error, ResponseCode.InternalServerError);
            }
           
        }

        public JsonResult AddMovie(MovieVM movie)
        {
            try
            {
                int id = GenerateId();
                lock (movies)
                {
                    movies.Add(id, movie);
                }
                movie.Id = id;
                return new JsonResult(new ApiResponse<MovieVM>()
                {
                    Data = movie,
                    Message = ResponseMessage.Success,
                    StatusCode = ResponseCode.Success,
                    Result = true

                });
            }

            catch
            {
                return ReturnError(ResponseMessage.Error, ResponseCode.InternalServerError);
            }
        }

        public JsonResult UpdateMovie(MovieVM movie)
        {
            try
            {
                lock (movies)
                {
                    if(movies.ContainsKey(movie.Id))
                    {
                        movies[movie.Id] = movie;
                    }
                    else
                    {
                        return ReturnError(ResponseMessage.MovieNotFound, ResponseCode.NotFound);
                    }
                    
                }

                return new JsonResult(new ApiResponse<MovieVM>()
                {
                    Data = movie,
                    Message = ResponseMessage.Success,
                    StatusCode = ResponseCode.Success,
                    Result = true
                });
            }

            catch
            {
                return ReturnError(ResponseMessage.Error, ResponseCode.InternalServerError);
            }
        }

        public JsonResult DeleteMovie(int id)
        {
            try
            {
                lock (movies)
                {
                    if (movies.ContainsKey(id))
                    {
                        movies.Remove(id);
                    }
                    else
                    {
                        return ReturnError(ResponseMessage.MovieNotFound, ResponseCode.NotFound);
                    }
                    
                }
                return new JsonResult(new ApiResponse<int>()
                {
                    Data = id,
                    Message = ResponseMessage.Success,
                    StatusCode = ResponseCode.Success,
                    Result = true
                });
            }

            catch
            {
                return ReturnError(ResponseMessage.Error, ResponseCode.InternalServerError);
            }
        }

        public JsonResult ReturnError(string message,int code)
        {
            return new JsonResult(new ApiResponse<string>()
            {
                Data = null,
                Message = message,
                StatusCode = code,
                Result = false

            });
        }

        public int GenerateId()
        {
            return movies.Keys.Last() + 1;
        }

